import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import $ from 'jquery';


import intantPhoto1 from '../../../assets/img/team/made-to-focus-photoart-compressed.jpg'; 
import intantPhoto2 from '../../../assets/img/team/made-to-rest-photoart-compressed.jpg';  
import intantPhoto3 from '../../../assets/img/team/made-to-enjoy-photoart-compressed.jpg';  
import transparentlogo from '../../../assets/img/team/transparent-logo.png';  


class Aboutme extends Component {
    componentDidMount() {
        
    }
    render() {
        return (
            <section className="about-section pt-115 pb-115">
                <div className="container about-container ">
                    
                    <div className="section-title about-title text-center">
                        <span className="title-tag">Why We Do.
                            <br/>   
                            What We Do.</span>
                        <h2>Made with Purpose</h2>
                        <br />
                        
                        <p><strong>Urban Fox Rentals</strong>, started as a simple idea: make moving easier for people who have enough on their plates already. I saw how much time, money, and energy goes into finding a good place to live—especially for working professionals, students, and healthcare workers—and I wanted to create something better.</p>
                        
                        

                        <p>Over the years, I found myself moving a lot — sometimes for school, sometimes for work. I was constantly packing up, starting fresh, and looking for a place that made it easy to focus and settle in. Every experience helped me understand that where you live shapes how you live. A well-equipped, thoughtfully designed space gives people room to breathe, work, and grow. </p>
                        


                        <p>Urban Fox was built to provide furnished, ready-to-live-in apartments that are thoughtfully equipped, fairly priced, and designed to feel like home from day one. It's housing that respects your time, your budget, and your need for privacy and quality.</p>
                        <div className="photo-container">
  <img  src={intantPhoto3} alt="Made to Enjoy" className="instant-photo-img"/>
</div>
                        
                       <p> <strong>Urban Fox Rentals</strong>  is more than a furnished rental service. It’s a way to offer high-quality, equitable housing to people who need flexibility without compromise. Every apartment is set up the way I’d want to live in it myself: stocked, clean, welcoming, and private—with no corners cut.</p>
                       <br/>
                       <div className="photo-container">
  <img  src={transparentlogo} alt="Urban Fox Logo" className="instant-photo-logo"/>
</div>


                    </div>
                    
                </div>
            </section>
        );
    }
}

export default Aboutme;
